import React from 'react';
import {Swiper, SwiperSlide} from "swiper/swiper-react";

const Time: React.FC = () => {
    const TIME_HOURS = Array.from(Array(24).keys());
    const TIME_MINUTES = Array(12)
        .fill(0)
        .map((num, i) => i * 5);
    return (
        <div className='w-full flex justify-center items-center'>
            <Swiper
                className="h-[16.8rem]  px-[1.1rem]"
                direction={"vertical"}
                slidesPerView={3}
                mousewheel
                loopAdditionalSlides={5}
                slideToClickedSlide
                centeredSlides
                onSlideChange={(swiper : any) => console.log(swiper)}
            >
                {TIME_HOURS.map((hour) => (
                    <SwiperSlide key={hour}>
                        <div className="flex h-[5.6rem] cursor-pointer items-center">
                            {(hour + "").padStart(2, "0")}
                        </div>
                    </SwiperSlide>
                ))}
            </Swiper>
        </div>
    );
};

export default Time;
